const audio1 = new Audio('data:audio/mp3;base64,');
const audio2 = new Audio('data:audio/mp3;base64,');
const audio3 = new Audio('data:audio/mp3;base64,');
const beep = (audio) => {
  audio.play().then(() => {
    // fire and forget
  });
};

const beep1 = beep.bind(null, audio1);
const beep2 = beep.bind(null, audio2);
const beep3 = beep.bind(null, audio3);
export {beep1, beep2, beep3};
